import React, { Component } from 'react'
import imageWriterDay from '../img/Kolas.jpg' // relative path to image 

export default class AboutDevelopers extends Component {
    render() {
        return (
            <div class="container">
            <hr></hr>
            <h1 class="jumbotron-heading">Деятель дня</h1>
            <p class="lead text-muted">
                Здесь вы кратко можете ознакомиться с деятелем дня.
            </p>
            <div class="row">
                <div class="col-sm">
                    Семенько Максим
                </div>
                <div class="col-sm">
                    Дубяго Андрей
                </div>
            </div>
        </div>
        );
    }
}
